import React from "react";
import "./Buttons.css";

const ButtonPlay = ({ icon, onClick }) => {
  return (
    <button className="btn btn-play">
      <ion-icon name={icon} onClick={onClick} />
    </button>
  );
};

export default ButtonPlay;
